import React from 'react'

class LeaderboardView extends React.Component{

    state = { leaderboardName : "Leaderboard1", leaderboardEntries :["A","B"] }

    render(){
        return(
            <div>
                Leaderboard : {this.state.leaderboardName}
                LeaderboardEntries :
                <div>
                    <h1>
                    {this.state.leaderboardEntries.map(( leaderboard )=> {
                        return leaderboard
                    })}
                    </h1>

                </div>
            </div>
        )
    }
}

export default LeaderboardView;
